"""
LeetCode :: May 2022 Challenge :: Remove All Adjacent Duplicates in String II
jramaswami
"""


class Solution:
    def removeDuplicates(self, S: str, k: int) -> str:
        stack = []
        for c in S:
            stack.append(c)
            while len(stack) >= k and len(set(stack[-k:])) == 1:
                stack = stack[:-k]
        return "".join(stack)
            

def test_1():
    s = "abcd"
    k = 2
    assert Solution().removeDuplicates(s, k) == "abcd"


def test_2():
    s = "deeedbbcccbdaa"
    k = 3
    assert Solution().removeDuplicates(s, k) == "aa"


def test_3():
    s = "pbbcggttciiippooaais"
    k = 2
    assert Solution().removeDuplicates(s, k) == "ps"


def test_4():
    "TLE"
    s = ""
    k = 10000
    assert Solution().removeDuplicates(s, k) == "ps"